import React from "react";
import CartItem from "./CartItem";

function CartItemsList({ selectUser, userCartItems }){
  return(
    <div>
      {userCartItems.map(cartItem => <CartItem item={cartItem} />)}
    </div>
  )
}

export default CartItemsList;
